import React from 'react';

import SportSeeLogo from '../../assets/icons/sportsee_logo.svg';
import { Link } from 'react-router-dom';

import './Header.css';

const Header = () => {
	return (
		<header className="header">
			<div className="header__logo">
				<Link to="/">
					<img src={SportSeeLogo} alt="SportSee Logo" />
				</Link>
			</div>
			<nav>
				<ul className="header__nav">
					<Link to="user/:id/home" className="active">
						Accueil
					</Link>
					<Link to="user/:id/profil">Profil</Link>
					<Link to="user/:id/settings">Settings</Link>
					<Link to="user/:id/community">Communaut√©</Link>
				</ul>
			</nav>
		</header>
	);
};

export default Header;
